What will be the output of the following C++ code?
#include <iostream>
using namespace std;

class A 
{
   int a;
   A() { a = 5;}
};

int main()
{
    A *obj = new A;
    cout << obj->a;
}
,Compile Time Error

Which out of the following features of OOPs is not used in the following C++ code (Inheritance , Abstraction , Polymorphism)
class A
{
    int i;
    public:
    void print(){cout<<"hello"<<i;}
}

class B: public A
{
    int j;
    public:
    void assign(int a){j = a;}
},Polymorphism

What will be the output of the following C++ code?
#include<iostream>
using namespace std;
int x = 1;
int main()
{
    int x = 2;
    {
        int x = 3;
        cout << ::x << endl;
    }
    return 0;
}
,1

