What will be the output of the following C code?

#include <stdio.h>
#define EVEN 0 
#define ODD 0 
int main()
{
  int i = 3;
  switch (i & 1)
  {
    case EVEN: printf("Even");
      break;
    case ODD: printf("odd");
      break;
    default: printf("Default");
  }
  return 0;
}

,ODD

